import jsPDF from 'jspdf';
import autoTable, { UserOptions } from 'jspdf-autotable';
import { ProposalData } from '../types';

// Extended jsPDF type to support autoTable
type jsPDFWithAutoTable = jsPDF & {
  lastAutoTable?: {
    finalY: number;
  };
};

// Robust Font Loading Helper
const loadFont = async (url: string): Promise<string> => {
  const response = await fetch(url);
  if (!response.ok) {
    throw new Error(`Failed to fetch font: ${response.statusText}`);
  }
  const buffer = await response.arrayBuffer();
  const bytes = new Uint8Array(buffer);
  let binary = '';
  for (let i = 0; i < bytes.byteLength; i++) {
    binary += String.fromCharCode(bytes[i]);
  }
  return window.btoa(binary);
};

// ==========================================
// LOGO CONFIGURATION
// ==========================================
// 1. Lütfen https://www.remove.bg gibi bir site ile logonuzun arka planını temizleyin (Transparent PNG).
// 2. Temizlenen resmi Base64'e çevirin.
// 3. Aşağıdaki tırnak işaretlerinin içine yapıştırın.
const FIXED_LOGO_BASE64: string = "data:image/jpeg;base64,"; // <--- BURAYA ŞEFFAF PNG BASE64 KODUNUZU YAPIŞTIRIN

export const generateProposalPDF = async (data: ProposalData) => {
  const doc = new jsPDF() as jsPDFWithAutoTable;
  const pageWidth = doc.internal.pageSize.width; // 210mm

  let fontLoaded = false;

  // --- Load Custom Fonts (Roboto) ---
  try {
    const fontRegular = await loadFont('https://cdnjs.cloudflare.com/ajax/libs/pdfmake/0.1.66/fonts/Roboto/Roboto-Regular.ttf');
    const fontBold = await loadFont('https://cdnjs.cloudflare.com/ajax/libs/pdfmake/0.1.66/fonts/Roboto/Roboto-Medium.ttf');

    doc.addFileToVFS('Roboto-Regular.ttf', fontRegular);
    doc.addFont('Roboto-Regular.ttf', 'Roboto', 'normal');

    doc.addFileToVFS('Roboto-Bold.ttf', fontBold);
    doc.addFont('Roboto-Bold.ttf', 'Roboto', 'bold');

    doc.setFont('Roboto', 'normal');
    fontLoaded = true;
  } catch (error) {
    console.warn("Font loading failed, falling back to Helvetica.", error);
    doc.setFont("helvetica", "normal");
    fontLoaded = false;
  }

  // Helper to safely set font
  const setFont = (style: 'normal' | 'bold' = 'normal') => {
    if (fontLoaded) {
      doc.setFont('Roboto', style);
    } else {
      doc.setFont('helvetica', style);
    }
  };

  // ==========================================
  // LOGO RENDERING (Aspect Ratio Fix)
  // ==========================================
  const drawLogo = (x: number, y: number) => {
    if (FIXED_LOGO_BASE64 && FIXED_LOGO_BASE64.startsWith('data:image')) {
      try {
        const imgProps = doc.getImageProperties(FIXED_LOGO_BASE64);

        // --- LOGO BOYUTLANDIRMA ---
        // Genişlik 160mm (Boyut iyi dendiği için korundu)
        const logoWidth = 160;
        const maxHeight = 60;

        const logoHeight = (imgProps.height * logoWidth) / imgProps.width; // Calculate height based on ratio

        // Eğer yükseklik çok fazla olursa (örn: kare logo), yüksekliği sabitleyip genişliği ayarlayalım
        if (logoHeight > maxHeight) {
          const fixedHeight = maxHeight;
          const fixedWidth = (imgProps.width * fixedHeight) / imgProps.height;
          doc.addImage(FIXED_LOGO_BASE64, 'PNG', -15, y, fixedWidth, fixedHeight);
        } else {
          doc.addImage(FIXED_LOGO_BASE64, 'PNG', -15, y, logoWidth, logoHeight);
        }

      } catch (e) {
        console.error("Logo eklenirken hata oluştu:", e);
        drawTextLogo(x, y + 5);
      }
    } else {
      drawTextLogo(x, y + 5);
    }
  };

  const drawTextLogo = (x: number, y: number) => {
    if (fontLoaded) doc.setFont('Roboto', 'bold');
    else doc.setFont('helvetica', 'bold');

    doc.setFontSize(32);
    doc.setTextColor(11, 47, 94); // #0B2F5E
    doc.text("Fankur", x, y);

    if (fontLoaded) doc.setFont('Roboto', 'normal');
    else doc.setFont('helvetica', 'normal');

    doc.setFontSize(8);
    doc.setTextColor(60, 60, 60);
    doc.text("Havalandırma ve Isıtma Sistemleri LTD. ŞTİ.", x, y + 6);
  };

  // ==========================================
  // PAGE 1: OFFER
  // ==========================================

  // --- Header ---
  // Logo X koordinatı 5 (Sola yaslı)
  // Y koordinatı 10
  drawLogo(5, 10);

  // Date
  setFont('normal');
  doc.setFontSize(10);
  doc.setTextColor(0, 0, 0);
  const dateStr = new Date(data.date).toLocaleDateString('tr-TR');
  // Tarihi sağ üstte tutuyoruz (205mm to fit with 5mm margin)
  doc.text(`Tarih: ${dateStr}`, 205, 25, { align: 'right' });

  // --- Customer & Subject ---
  // Logo çok büyük olduğu için içerik başlangıcı 85
  let yPos = 85;

  // Project Name - Aligned to x=5
  doc.setFontSize(12);
  setFont('bold');
  doc.text(data.projectName.toUpperCase(), 5, yPos);

  // Attention To - Aligned to x=5
  yPos += 7;
  setFont('bold');
  doc.text(`Sn. ${data.attentionTo}`, 5, yPos);

  // Subject - Aligned to x=5
  yPos += 12;
  setFont('bold');
  doc.text(`KONU: ${data.subject}`, 5, yPos);
  doc.setLineWidth(0.5);
  doc.setDrawColor(0, 0, 0);
  doc.line(5, yPos + 2, 70, yPos + 2); // Length kept reasonable

  // Intro - Aligned to x=5
  yPos += 12;
  setFont('normal');
  doc.setFontSize(10);
  doc.setTextColor(50, 50, 50);
  const introText = "İstemiş olduğunuz ekipmanlarla ilgili olarak fiyat teklifimiz aşağıda bilgilerinize sunulmuştur. Teklifimizin kabul göreceğini umar, işlerinizde başarılar dileriz.\n\nSaygılarımızla,";
  const splitIntro = doc.splitTextToSize(introText, 200); // Width increased for 5mm margin
  doc.text(splitIntro, 5, yPos);

  // --- Signatories ---
  yPos += 20;

  if (data.signatories.length > 0) {
    const sigCount = data.signatories.length;
    let positions: number[] = [];
    if (sigCount === 1) positions = [5];
    else if (sigCount === 2) positions = [5, 120];
    else {
      const margin = 5;
      const availableWidth = pageWidth - (margin * 2);
      const step = availableWidth / (sigCount - 1);
      for (let i = 0; i < sigCount; i++) positions.push(margin + (i * step));
    }

    data.signatories.forEach((sig, index) => {
      const x = positions[index] || 5;

      setFont('bold');
      doc.setTextColor(0, 0, 0);
      doc.setFontSize(10);
      doc.text(sig.name.toUpperCase(), x, yPos);

      setFont('normal');
      doc.setFontSize(9);
      doc.setTextColor(0, 50, 200); // Blue email
      doc.text(sig.email, x, yPos + 5);
    });
  }

  doc.setTextColor(0, 0, 0);

  // --- Material Table ---
  yPos += 20;
  doc.setFontSize(12);
  setFont('bold');
  doc.text(data.page1Title || "YERDEN ISITMA MALZEME LİSTESİ", 5, yPos); // Aligned to x=5

  const totalAmount = data.materials.reduce((sum, item) => sum + (item.requestQty * item.unitPrice), 0);

  const tableHead = [
    ['S.N.', 'ÜRÜN KODU', 'ÜRÜN TANIMI', 'EBAT/DETAY', 'MİKTAR', 'BİRİM', 'BİRİM FİYAT', 'TUTAR']
  ];

  const tableBody = data.materials.map((item, index) => [
    (index + 1).toString(),
    item.productCode,
    item.description,
    item.dimensions,
    item.requestQty.toString(),
    item.unit,
    `${item.unitPrice.toFixed(2)}`,
    `${(item.requestQty * item.unitPrice).toFixed(2)}`
  ]);

  autoTable(doc, {
    startY: yPos + 3,
    head: tableHead,
    body: tableBody,
    theme: 'plain',
    margin: { left: 5, right: 5 }, // 5mm margins
    headStyles: {
      fillColor: [240, 240, 240],
      textColor: 0,
      fontStyle: 'bold',
      halign: 'center',
      valign: 'middle',
      lineWidth: 0.1,
      lineColor: [200, 200, 200],
      font: fontLoaded ? 'Roboto' : 'helvetica'
    },
    styles: {
      font: fontLoaded ? 'Roboto' : 'helvetica',
      fontSize: 8,
      textColor: [40, 40, 40],
      lineWidth: 0.1,
      lineColor: [200, 200, 200],
      valign: 'middle'
    },
    columnStyles: {
      0: { cellWidth: 10, halign: 'center' },
      1: { cellWidth: 20 },
      2: { cellWidth: 'auto' },
      3: { cellWidth: 30 },
      4: { cellWidth: 15, halign: 'center' },
      5: { cellWidth: 15, halign: 'center' },
      6: { cellWidth: 20, halign: 'right' },
      7: { cellWidth: 20, halign: 'right' }
    }
  });

  // Total Box
  let finalY = doc.lastAutoTable?.finalY || 150;

  finalY += 20;

  // Draw Total Box - Aligned to right margin (205)
  // Width 60, so x = 205 - 60 = 145
  doc.setFillColor(245, 245, 245);
  doc.rect(145, finalY, 60, 10, 'F');
  doc.setDrawColor(200, 200, 200);
  doc.rect(145, finalY, 60, 10, 'S');

  setFont('bold');
  doc.setFontSize(10);
  doc.text("TOPLAM TUTAR:", 148, finalY + 6.5);
  doc.text(`${totalAmount.toLocaleString('tr-TR', { minimumFractionDigits: 2, maximumFractionDigits: 2 })} ${data.currency}`, 202, finalY + 6.5, { align: 'right' });

  // --- Notes ---
  finalY += 18;
  doc.setFontSize(10);
  setFont('bold');
  doc.text("NOTLAR / ŞARTLAR:", 5, finalY); // Aligned to x=5

  setFont('normal');
  doc.setFontSize(9);
  doc.setTextColor(60, 60, 60);
  let noteY = finalY + 6;

  data.notes.forEach((note, index) => {
    if (noteY > 260) {
      doc.addPage();
      noteY = 20;
    }
    const noteText = `${index + 1} - ${note}`;
    const splitNote = doc.splitTextToSize(noteText, 200); // Wider text
    doc.text(splitNote, 5, noteY); // Aligned to x=5
    noteY += (splitNote.length * 4) + 2;
  });

  // --- Footer ---
  const footerY = 280;
  const pageCount = doc.getNumberOfPages();
  for (let i = 1; i <= pageCount; i++) {
    doc.setPage(i);
    doc.setDrawColor(200, 200, 200);
    doc.setLineWidth(0.5);
    doc.line(5, footerY, 205, footerY); // Adjusted for margins

    doc.setFontSize(8);
    doc.setTextColor(100, 100, 100);
    doc.text("FANKUR Havalandırma ve Isıtma Sistemleri  LTD. ŞTİ.", 105, footerY + 5, { align: 'center' });
    doc.text("Adres: Prof. Dr. Necmettin Erbakan Caddesi Erdoğan Apt No 31 Daire 4 - İstanbul", 105, footerY + 9, { align: 'center' });
    doc.text("Tel: +535 708 54 44  |  Email: info@fankur.com  |  Web: www.fankur.com", 105, footerY + 13, { align: 'center' });
  }
  doc.setPage(pageCount);

  // ==========================================
  // PAGE 2: DISCOVERY
  // ==========================================
  doc.addPage();

  // Header Logo - Daha sola (5)
  drawLogo(5, 10);

  // Date Box - Shifted right
  doc.setDrawColor(0);
  doc.rect(175, 15, 30, 8); // 165 -> 175
  doc.setFontSize(10);
  doc.setTextColor(0);
  doc.text(dateStr, 190, 20, { align: 'center' }); // 180 -> 190

  // Title
  doc.setFontSize(14);
  setFont('normal'); // Title font
  doc.text(data.page2Title || "YERDEN ISITMA KEŞİF ÖZETİ", 5, 80); // x: 15 -> 5

  // Discovery Table
  const discHead = [
    ['#', 'KAT', 'MAHAL', 'ALAN\n(m²)', 'Yoğunluk\n(mt/m²)', 'BORU\n(mt)', 'DEVRE', 'TERM.', 'KOLLEKTÖR']
  ];

  const discBody = data.discovery.map((item, index) => [
    (index + 1).toString(),
    item.floor,
    item.roomName,
    item.area.toLocaleString('tr-TR'),
    item.pipeDensity.toString(),
    `${item.pipeLength}`,
    item.circuits || '',
    item.thermostat || '',
    item.collector || ''
  ]);

  const totalArea = data.discovery.reduce((sum, i) => sum + i.area, 0);
  const totalPipe = data.discovery.reduce((sum, i) => sum + i.pipeLength, 0);
  const totalCircuits = data.discovery.reduce((sum, i) => sum + (Number(i.circuits) || 0), 0);
  const totalThermostats = data.discovery.reduce((sum, i) => sum + (Number(i.thermostat) || 0), 0);

  discBody.push([
    '', 'GENEL TOPLAM', '', `${totalArea.toLocaleString('tr-TR')}`, '', `${totalPipe}`, `${totalCircuits}`, `${totalThermostats}`, ''
  ]);

  autoTable(doc, {
    startY: 85,
    head: discHead,
    body: discBody,
    theme: 'grid',
    margin: { left: 5, right: 5 }, // 5mm margins
    headStyles: {
      fillColor: [50, 50, 50],
      textColor: 255,
      fontStyle: 'bold',
      halign: 'center',
      valign: 'middle',
      font: fontLoaded ? 'Roboto' : 'helvetica'
    },
    styles: {
      font: fontLoaded ? 'Roboto' : 'helvetica',
      fontSize: 9,
      textColor: 0,
      lineWidth: 0.1,
      lineColor: [200, 200, 200],
      halign: 'center',
      valign: 'middle'
    },
    columnStyles: {
      2: { halign: 'left' }
    },
    didParseCell: (data) => {
      if (data.row.index === discBody.length - 1) {
        data.cell.styles.fontStyle = 'bold';
        data.cell.styles.fillColor = [240, 240, 240];
      }
    }
  });

  doc.save(`Fankur_Teklif_${data.projectName.replace(/\s+/g, '_')}.pdf`);
};